export default function categoryRecipesReducer(state = {}, action
    : { type: string; categoryRecipes: object }) {
  switch (action.type) {
    case 'GET_CATEGORY_RECIPES':
      console.log(action.categoryRecipes);
      return action.categoryRecipes;
    default:
      return state;
  }
}
